import React from "react";
import styles from "../styles/words.module.css";

const Words = ({ word, translate }) => {    
  return (
    <div className={styles.container}>
        <div className={styles.word}></div>
      {Array.from(Array(word.length), (e, i) => {
        return <div key={i}>{word[i]}</div>;
      })}
      {Array.from(Array(translate.length), (e, i) => {
        return <div key={i}>{translate[i]}</div>;
      })}
    </div>
  );
};

export default Words;
